import React from 'react';
import IndexButton from '../../components/assets/IndexButton';

export default class ArticleIndexBarComponent extends React.Component {
  constructor(props: any) {
    super(props);
    this.toggle = this.toggle.bind(this);
  }

  state: State = {
    isIndexSidePanelOpen: false,
  };

  render() {
    return (
      <div className="ArticleIndexBar-Component">
        <div className="article-indexbar">
        <IndexSidePanel isOpen={isIndexSidePanelOpenn}/>
        <IndexButton toggleIndexSidePanel={this.toggle}/>
            <a className="breadcrumbs">USCENTCOM Medical Security Cooperation (MSC) Exchange Details</a> <span className="caret-breaker"> > </span> <a>Homepage</a>
        </div>
      </div>
    );
  }
}
type State = {
  isNavPanelOpen: boolean;
  isFeedbackOpen: boolean;
};
